CREATE TABLE product (
	product_code CHARACTER (3) PRIMARY KEY,
	product_type CHARACTER VARYING (7) NOT NULL
);

CREATE TABLE transactions (
	card_10digit INTEGER NOT NULL,
	cust_id INTEGER NOT NULL,
	product_code CHARACTER (3) NOT NULL,
	transaction_ID INTEGER PRIMARY KEY,
	transaction_Date DATE NOT NULL,
	transaction_amount NUMERIC (4, 0) NOT NULL,
	merchant_ID INTEGER NOT NULL,
	FOREIGN KEY (cust_id) REFERENCES customer_pii (cust_id) ON UPDATE CASCADE ON DELETE CASCADE,
	FOREIGN KEY (product_code) REFERENCES product (product_code) ON UPDATE CASCADE ON DELETE CASCADE,
	FOREIGN KEY (merchant_ID) REFERENCES merchant (merchant_ID) ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE merchant (
	merchant_ID INTEGER PRIMARY KEY,
	merchant_name CHARACTER VARYING (10) NOT NULL,
	merchant_type CHARACTER VARYING (7) NOT NULL
);

CREATE TABLE customer_pii (
	cust_id SERIAL PRIMARY KEY,
	first_name CHARACTER VARYING (20),
	last_name CHARACTER VARYING (25) NOT NULL,
	email_id CHARACTER VARYING (100) NOT NULL,
	phone_no CHARACTER VARYING (20),
	city CHARACTER VARYING (11) NOT NULL,
	province CHARACTER VARYING (16) NOT NULL,
	country  CHARACTER VARYING (6) NOT NULL,
	membership_date DATE NOT NULL,
	DOB DATE NOT NULL
);





